import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Home Page</h1>
      <nav>
        <Link to="/about">Go to About Page</Link>
      </nav>
    </div>
  );
}

function About() {
  return (
    <div>
      <h1>About Page</h1>
      <nav>
        <Link to="/">Go to Home Page</Link>
      </nav>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
